svg.script:
//

    document.wheels = [0, 0, 0, 0];

    document.setWheels = newWheels => {
      for(let i = 0; i < 4; i++) {
        document.getElementById(`wheel-${i}`).setAttribute("transform", `rotate(${-newWheels[i] * 24})`);
      }
    }

    const controlPlateAnim = (direction, dur) => {
      const pos = {
        "U": [0, -20],
        "R": [20, 0],
        "D": [0, 20],
        "L": [-20, 0],
      }[direction];

      const controlPlate = document.getElementById("control-plate");
      const a = document.createElementNS("http://www.w3.org/2000/svg", "animateTransform");
      a.setAttribute("attributeName", "transform");
      a.setAttribute("attributeType", "XML");
      a.setAttribute("type", "translate");
      a.setAttribute("dur", dur);
      a.setAttribute("values", `0 0; ${pos[0]} ${pos[1]}; 0 0`);
      a.setAttribute("keyTimes", "0; 0.5; 1");
      a.setAttribute("fill", "freeze");
      controlPlate.appendChild(a);
      a.beginElement();
    };

    const wheelAnim = (wheelIndex, startAngle, interactionType, dur) => {
      const alphaKeyValues = "0;24";
      const alphaKeyTimes = "0;1";
      const betaKeyValues = "0;48";
      const betaKeyTimes = "0;1";
      const gammaKeyValues = "0;72";
      const gammaKeyTimes = "0;1";

      const [keyValues, keyTimes] = {
        "alpha": [alphaKeyValues, alphaKeyTimes],
        "beta": [betaKeyValues, betaKeyTimes],
        "gamma": [gammaKeyValues, gammaKeyTimes],
      }[interactionType];

      if (!keyValues) {
        return; // No motion
      }

      // Rewrite key values based on starting angle
      const newKeyValues = keyValues.split(";").map(v => -(parseFloat(v) + 24 * startAngle)).join(";");

      const wheel = document.getElementById(`wheel-${wheelIndex}`);
      const a = document.createElementNS("http://www.w3.org/2000/svg", "animateTransform");
      a.setAttribute("attributeName", "transform");
      a.setAttribute("attributeType", "XML");
      a.setAttribute("type", "rotate");
      a.setAttribute("dur", dur);
      a.setAttribute("values", newKeyValues);
      a.setAttribute("keyTimes", keyTimes);
      a.setAttribute("fill", "freeze");
      wheel.appendChild(a);
      a.beginElement();
    };

    document.dial = direction => {
      dur = "8s";
      controlPlateAnim("U", dur);
      wheelAnim(0, 0, "gamma", dur);
      wheelAnim(1, 0, "alpha", dur);
      wheelAnim(3, 0, "beta", dur);
    }
  //
